css:
:root {
  font-size: 16px;
}
atom-panel.left .build,
atom-panel.right .build {
  width: 250px;
  display: flex;
  flex-direction: column;
}
atom-panel.left .build .output,
atom-panel.right .build .output {
  flex-grow: 1;
}
atom-panel.left .build .resizer,
atom-panel.right .build .resizer {
  cursor: col-resize;
  height: 100%;
  top: 0;
}
atom-panel.left .build .resizer {
  right: 0;
}
atom-panel.right .build .resizer {
  left: 0;
}
